073\u0028\u0027\u0064\u002D\u006E\u006F\u006E\u0065\u0027\u0029\u003B\u000A\u0009\u0024\u0028\u0027\u0023\u006C\u006F\u0067\u0069\u006E\u002C\u0023\u0065\u0079\u0065\u0073\u0027\u0029\u002E\u0072\u0065\u006D\u006F\u0076\u0065\u0043\u006C\u0061\u0073\u0073\u0028\u0027\u0064\u002D\u006E\u006F\u006E\u0065\u0027\u0029\u003B\u000A\u0009\u0024\u0028\u0027\u0023\u006C\u006F\u0067\u0069\u006E\u0027\u0029\u002E\u0070\u0072\u006F\u0070\u0028\u0027\u0064\u0069\u0073\u0061\u0062\u006C\u0065\u0064\u0027\u002C\u0020\u0066\u0061\u006C\u0073\u0065\u0029\u003B\u000A\u0009\u0024\u0028\u0027\u002E\u0065\u0079\u0065\u0027\u0029\u002E\u0074\u0065\u0078\u0074\u0028\u0027\u0058\u0027\u0029\u003B\u000A\u0009\u0024\u0028\u0027\u0023\u0069\u006E\u0074\u0072\u006F\u0027\u0029\u002E\u0074\u0065\u0078\u0074\u0028\u0027\u0057\u0065\u006C\u0063\u006F\u006D\u0065\u0027\u0029\u003B\u000A\u007D\u000A\u0066\u0075\u006E\u0063\u0074\u0069\u006F\u006E\u0020\u0063\u006F\u006E\u006E\u0065\u0063\u0074\u0028\u0029\u0020\u007B\u000A\u0009\u0024\u0028\u0027\u002E\u0074\u006F\u0067\u0027\u0029\u002E\u0061\u0064\u0064\u0043\u006C\u0061\u0073\u0073\u0028\u0027\u0064\u002D\u006E\u006F\u006E\u0065\u0027\u0029\u003B\u000A\u0009\u0024\u0028\u0027\u0023\u0064\u006F\u0074\u0073\u002C\u0023\u006C\u006F\u0067\u0069\u006E\u0027\u0029\u002E\u0072\u0065\u006D\u006F\u0076\u0065\u0043\u006C\u0061\u0073\u0073\u0028\u0027\u0064\u002D\u006E\u006F\u006E\u0065\u0027\u0029\u003B\u000A\u0009\u0024\u0028\u0027\u0023\u006C\u006F\u0067\u0069\u006E\u0027\u0029\u002E\u0070\u0072\u006F\u0070\u0028\u0027\u0064\u0069\u0073\u0061\u0062\u006C\u0065\u0064\u0027\u002C\u0020\u0074\u0072\u0075\u0065\u0029\u003B\u000A\u0009\u007A\u0065\u0072\u006F\u0028\u0029\u003B\u000A\u0009\u0074\u0072\u0079\u007B\u000A\u0009\u0009\u0069\u0066\u0028\u0021\u0066\u0072\u006F\u006D\u0044\u0061\u0070\u0070\u0042\u0072\u006F\u0077\u0073\u0065\u0072\u0029\u007B\u000A\u0009\u0009\u0009\u0053\u0063\u0061\u0074\u0074\u0065\u0072\u004A\u0053\u002E\u0063\u006F\u006E\u006E\u0065\u0063\u0074\u0028\u0061\u0070\u0070\u006E\u0061\u006D\u0065\u002C\u007B\u006E\u0065\u0074\u0077\u006F\u0072\u006B\u007D\u0029\u002E\u0074\u0068\u0065\u006E\u0028\u0063\u006F\u006E\u006E\u0065\u0063\u0074\u0065\u0064\u0020\u003D\u003E\u0020\u007B\u000A\u0009\u0009\u0009\u0009\u0069\u0066\u0028\u0021\u0063\u006F\u006E\u006E\u0065\u0063\u0074\u0065\u0064\u0029\u0020\u007B\u000A\u0061\u006C\u0065\u0072\u0074\u0028\u0022\u0050\u006C\u0065\u0061\u0073\u0065\u0020\u006C\u006F\u0067\u0069\u006E\u0020\u0056\u0065\u0078\u0077\u0061\u006C\u006C\u0065\u0074\u0022\u0029\u003B\u000A\u0009\u0009\u0009\u0009\u0009\u006E\u006F\u0074\u0043\u006F\u006E\u006E\u0065\u0063\u0074\u0065\u0064\u0028\u0029\u003B\u000A\u0009\u0009\u0009\u0009\u0009\u0072\u0065\u0074\u0075\u0072\u006E\u003B\u000A\u0009\u0009\u0009\u0009\u007D\u000A\u0009\u0009\u0009\u0009\u006C\u006F\u0067\u0069\u006E\u0028\u0029\u003B\u000A\u0009\u0009\u0009\u007D\u0029\u003B\u000A\u0009\u0009\u007D\u0020\u0065\u006C\u0073\u0065\u0020\u007B\u000A\u0009\u0009\u0009\u0070\u0065\u002E\u0067\u0065\u0074\u0057\u0061\u006C\u006C\u0065\u0074\u0057\u0069\u0074\u0068\u0041\u0063\u0063\u006F\u0075\u006E\u0074\u0028\u0029\u002E\u0074\u0068\u0065\u006E\u0028\u0028\u0072\u0065\u0073\u0029\u003D\u003E\u007B\u000A\u0009\u0009\u0009\u0009\u0069\u0066\u0028\u0021\u0072\u0065\u0073\u0029\u0020\u007B\u000A\u0009\u0009\u0009\u0009\u0009\u006E\u006F\u0074\u0043\u006F\u006E\u006E\u0065\u0063\u0074\u0065\u0064\u0028\u0029\u003B\u000A\u0009\u0009\u0009\u0009\u0009\u0072\u0065\u0074\u0075\u0072\u006E\u003B\u000A\u0009\u0009\u0009\u0009\u007D\u000A\u0009\u0009\u0009\u0009\u0061\u0063\u0063\u006F\u0075\u006E\u0074\u0020\u003D\u0020\u0072\u0065\u0073\u002E\u0064\u0061\u0074\u0061\u002E\u0061\u0063\u0063\u006F\u0075\u006E\u0074\u003B\u000A\u0009\u0009\u0009\u0009\u006F\u006E\u0043\u006F\u006E\u006E\u0065\u0063\u0074\u0065\u0064\u0028\u0029\u003B\u000A\u0009\u0009\u0009\u007D\u0029\u003B\u0009\u000A\u0009\u0009\u007D\u000A\u0009\u007D\u0020\u0063\u0061\u0074\u0063\u0068\u0020\u0028\u0065\u0029\u0020\u007B\u000A\u0009\u0009\u0063\u006F\u006E\u0073\u006F\u006C\u0065\u002E\u006C\u006F\u0067\u0028\u0065\u0029\u003B\u000A\u0009\u007D\u000A\u007D\u000A\u0066\u0075\u006E\u0063\u0074\u0069\u006F\u006E\u0020\u006E\u006F\u0074\u0043\u006F\u006E\u006E\u0065\u0063\u0074\u0065\u0064\u0028\u0029\u007B\u000A\u0009\u0024\u0028\u0027\u002E\u0074\u006F\u0067\u0027\u0029\u002E\u0061\u0064\u0064\u0043\u006C\u0061\u0073\u0073\u0028\u0027\u0064\u002D\u006E\u006F\u006E\u0065\u0027\u0029\u003B\u000A\u0009\u0024\u0028\u0027\u0023\u006C\u006F\u0067\u0069\u006E\u002C\u0023\u006E\u006F\u0070\u0065\u006E\u0027\u0029\u002E\u0072\u0065\u006D\u006F\u0076\u0065\u0043\u006C\u0061\u0073\u0073\u0028\u0027\u0064\u002D\u006E\u006F\u006E\u0065\u0027\u0029\u003B\u000A\u0009\u0073\u0065\u0074\u0054\u0069\u006D\u0065\u006F\u0075\u0074\u0028\u0073\u006C\u0065\u0065\u0070\u0079\u002C\u0020\u0035\u0030\u0030\u0029\u003B\u000A\u007D\u000A\u000A\u0066\u0075\u006E\u0063\u0074\u0069\u006F\u006E\u0020\u006C\u006F\u0067\u0069\u006E\u0028\u0029\u0020\u007B\u000A\u0009\u0074\u0072\u0079\u007B\u000A\u0009\u0009\u0053\u0063\u0061\u0074\u0074\u0065\u0072\u004A\u0053\u002E\u006C\u006F\u0067\u0069\u006E\u0028\u0029\u002E\u0074\u0068\u0065\u006E\u0028\u0069\u0064\u0020\u003D\u003E\u0020\u007B\u000A\u0009\u0009\u0009\u0069\u0066\u0028\u0021\u0069\u0064\u0029\u0020\u0072\u0065\u0074\u0075\u0072\u006E\u003B\u000A\u0009\u0009\u0009\u0061\u0063\u0063\u006F\u0075\u006E\u0074\u0020\u003D\u0020\u0069\u0064\u002E\u0061\u0063\u0063\u006F\u0075\u006E\u0074\u0073\u005B\u0030\u005D\u002E\u006E\u0061\u006D\u0065\u003B\u000A\u0009\u0009\u0009\u006F\u006E\u0043\u006F\u006E\u006E\u0065\u0063\u0074\u0065\u0064\u0028\u0029\u003B\u000A\u0009\u0009\u007D\u0029\u003B\u000A\u0009\u007D\u0020\u0063\u0061\u0074\u0063\u0068\u0020\u0028\u0065\u0029\u0020\u007B\u000A\u0009\u0009\u0063\u006F\u006E\u0073\u006F\u006C\u0065\u002E\u006C\u006F\u0067\u0028\u0065\u0029\u003B\u000A\u0009\u007D\u000A\u007D\u000A\u0066\u0075\u006E\u0063\u0074\u0069\u006F\u006E\u0020\u006F\u006E\u0043\u006F\u006E\u006E\u0065\u0063\u0074\u0065\u0064\u0028\u0029\u007B\u000A\u0009\u0024\u0028\u0027\u002E\u0074\u006F\u0067\u0027\u0029\u002E\u0061\u0064\u0064\u0043\u006C\u0061\u0073\u0073\u0028\u0027\u0064\u002D\u006E\u006F\u006E\u0065\u0027\u0029\u003B\u000A\u0009\u0024\u0028\u0027\u0023\u0067\u006F\u0074\u0069\u006E\u002C\u0023\u006C\u006F\u0067\u006F\u0075\u0074\u0027\u0029\u002E\u0072\u0065\u006D\u006F\u0076\u0065\u0043\u006C\u0061\u0073\u0073\u0028\u0027\u0064\u002D\u006E\u006F\u006E\u0065\u0027\u0029\u003B\u000A\u0009\u0024\u0028\u0027\u0023\u0079\u006F\u0075\u0072\u0042\u0070\u0027\u0029\u002E\u0074\u0065\u0078\u0074\u0028\u0061\u0063\u0063\u006F\u0075\u006E\u0074\u0029\u003B\u000A\u0020\u0024\u0028\u0027\u0023\u006D\u0079\u0062\u0061\u006C\u0061\u006E\u0063\u0065\u0027\u0029\u002E\u0074\u0065\u0078\u0074\u0028\u0062\u0061\u006C\u0061\u006E\u0063\u0065\u0029\u003B\u000A\u0020\u0024\u0028\u0027\u0023\u0062\u0061\u006C\u0061\u006E\u0063\u0065\u0027\u0029\u002E\u0074\u0065\u0078\u0074\u0028\u0062\u0061\u006C\u0061\u006E\u0063\u0065\u0029\u003B\u000A\u0009\u0024\u0028\u0027\u0023\u006C\u006F\u0067\u006F\u0075\u0074\u0027\u0029\u002E\u006F\u006E\u0028\u0027\u0063\u006C\u0069\u0063\u006B\u0020\u0074\u006F\u0075\u0063\u0068\u0027\u002C\u0020\u0066\u0075\u006E\u0063\u0074\u0069\u006F\u006E\u0028\u0029\u007B\u000A\u0009\u0009\u006C\u006F\u0067\u006F\u0075\u0074\u0028\u0029\u003B\u000A\u0009\u007D\u0029\u003B\u000A\u0009\u0067\u0065\u0074\u0069\u006E\u0066\u006F\u0028\u0061\u0063\u0063\u006F\u0075\u006E\u0074\u0029\u003B\u000A\u007D\u000A\u0066\u0075\u006E\u0063\u0074\u0069\u006F\u006E\u0020\u0067\u0065\u0074\u0069\u006E\u0066\u006F\u0028\u0029\u0020\u007B\u000A\u0009\u0074\u0072\u0079\u0020\u007B\u000A\u0009\u0009\u0063\u006F\u006E\u0073\u0074\u0020\u0076\u0065\u0078\u006E\u0065\u0074\u0020\u003D\u0020\u0056\u0065\u0078\u004E\u0065\u0074\u0028\u006E\u0065\u0074\u0077\u006F\u0072\u006B\u002 077\u006F\u0072\u0064\u0021\u0027\u000A\u0009\u0020\u0020\u0020\u0020\u007D\u0029\u003B\u000A\u0009\u0020\u0020\u0020\u0020\u0072\u0065\u0074\u0075\u0072\u006E\u003B\u000A\u0009\u007D\u000A\u0009\u000A\u0009\u0062\u0066\u0069\u0073\u0068\u0020\u003D\u0020\u006E\u0065\u0077\u0020\u0042\u006C\u006F\u0077\u0066\u0069\u0073\u0068\u0028\u0070\u0061\u0073\u0073\u0031\u0029\u003B\u000A\u0009\u0076\u0061\u0072\u0020\u006B\u0065\u0079\u0070\u0072\u0069\u0076\u0065\u006E\u0063\u0020\u003D\u0020\u0062\u0066\u0069\u0073\u0068\u002E\u0065\u006E\u0063\u0072\u0079\u0070\u0074\u0028\u0065\u006F\u0073\u006B\u0065\u0079\u0070\u0072\u0069\u0076\u0029\u003B\u000A\u0009\u000A\u0009\u006C\u006F\u0063\u0061\u006C\u0053\u0074\u006F\u0072\u0061\u0067\u0065\u002E\u0073\u0065\u0074\u0049\u0074\u0065\u006D\u0028\u0022\u006B\u0065\u0079\u0070\u0072\u0069\u0076\u0065\u006E\u0063\u0022\u002C\u0020\u006B\u0065\u0079\u0070\u0072\u0069\u0076\u0065\u006E\u0063\u0029\u003B\u000A\u0009\u006C\u006F\u0063\u0061\u006C\u0053\u0074\u006F\u0072\u0061\u0067\u0065\u002E\u0073\u0065\u0074\u0049\u0074\u0065\u006D\u0028\u0022\u006B\u0065\u0079\u0070\u0075\u0062\u0022\u002C\u0020\u0065\u006F\u0073\u006B\u0065\u0079\u0070\u0075\u0062\u0029\u003B\u000A\u0009\u006C\u006F\u0063\u0061\u006C\u0053\u0074\u006F\u0072\u0061\u0067\u0065\u002E\u0073\u0065\u0074\u0049\u0074\u0065\u006D\u0028\u0022\u0061\u0063\u0063\u006F\u0075\u006E\u0074\u006E\u0061\u006D\u0065\u0022\u002C\u0020\u0061\u0063\u0063\u006F\u0075\u006E\u0074\u006E\u0061\u006D\u0065\u0029\u003B\u000A\u0009\u000A\u0009\u0067\u006F\u0074\u006F\u0056\u0069\u0065\u0077\u0028\u0022\u0075\u006E\u006C\u006F\u0063\u006B\u0056\u0069\u0065\u0077\u0022\u0029\u003B\u000A\u0020\u0020\u0020\u0020\u007D\u0029\u003B\u000A\u0020\u0020\u0020\u0020\u000A\u0020\u0020\u0020\u0020\u0066\u0075\u006E\u0063\u0074\u0069\u006F\u006E\u0020\u0068\u0061\u006E\u0064\u006C\u0065\u0055\u006E\u006C\u006F\u0063\u006B\u0028\u0029\u0020\u007B\u000A\u0009\u0076\u0061\u0072\u0020\u0070\u0061\u0073\u0073\u0020\u003D\u0020\u0024\u0028\u0022\u0023\u0070\u0061\u0073\u0073\u0055\u006E\u006C\u006F\u0063\u006B\u0022\u0029\u002E\u0076\u0061\u006C\u0028\u0029\u003B\u000A\u0009\u0076\u0061\u0072\u0020\u006B\u0065\u0079\u0070\u0072\u0069\u0076\u0065\u006E\u0063\u0020\u003D\u0020\u006C\u006F\u0063\u0061\u006C\u0053\u0074\u006F\u0072\u0061\u0067\u0065\u002E\u0067\u0065\u0074\u0049\u0074\u0065\u006D\u0028\u0022\u006B\u0065\u0079\u0070\u0072\u0069\u0076\u0065\u006E\u0063\u0022\u0029\u003B\u000A\u0009\u000A\u0009\u0062\u0066\u0069\u0073\u0068\u0020\u003D\u0020\u006E\u0065\u0077\u0020\u0042\u006C\u006F\u0077\u0066\u0069\u0073\u0068\u0028\u0070\u0061\u0073\u0073\u0029\u003B\u000A\u0009\u0076\u0061\u0072\u0020\u0064\u0065\u0063\u0072\u0079\u0070\u0074\u0065\u0064\u0020\u003D\u0020\u0062\u0066\u0069\u0073\u0068\u002E\u0064\u0065\u0063\u0072\u0079\u0070\u0074\u0028\u006B\u0065\u0079\u0070\u0072\u0069\u0076\u0065\u006E\u0063\u0029\u003B\u000A\u0009\u0065\u006F\u0073\u006B\u0065\u0079\u0070\u0072\u0069\u0076\u0020\u003D\u0020\u0062\u0066\u0069\u0073\u0068\u002E\u0074\u0072\u0069\u006D\u005A\u0065\u0072\u006F\u0073\u0028\u0064\u0065\u0063\u0072\u0079\u0070\u0074\u0065\u0064\u0029\u003B\u0020\u002F\u002F\u0020\u0066\u006F\u0072\u0020\u0073\u0074\u0072\u0069\u006E\u0067\u002F\u0074\u0065\u0078\u0074\u0020\u0069\u006E\u0066\u006F\u0072\u006D\u0061\u0074\u0069\u006F\u006E\u000A\u0009\u000A\u0009\u0069\u0066\u0020\u0028\u0021\u0065\u0063\u0063\u002E\u0069\u0073\u0056\u0061\u006C\u0069\u0064\u0050\u0072\u0069\u0076\u0061\u0074\u0065\u0028\u0065\u006F\u0073\u006B\u0065\u0079\u0070\u0072\u0069\u0076\u0029\u0029\u0020\u007B\u000A\u0009\u0020\u0020\u0020\u0020\u0024\u0028\u0022\u0023\u0070\u0061\u0073\u0073\u0055\u006E\u006C\u006F\u0063\u006B\u0022\u0029\u002E\u0076\u0061\u006C\u0028\u0022\u0022\u0029\u003B\u000A\u0009\u0020\u0020\u0020\u0020\u000A\u0009\u0020\u0020\u0020\u0020\u004D\u002E\u0074\u006F\u0061\u0073\u0074\u0028\u007B\u000A\u0009\u0009\u0068\u0074\u006D\u006C\u003A\u0020\u0027\u0057\ 00A\u007D\u0029\u000A\u007D\u0029\u003B\u000A\u000A\u0024\u0028\u0022\u0023\u0063\u006C\u0061\u0069\u006D\u0022\u0029\u002E\u0063\u006C\u0069\u0063\u006B\u0028\u0066\u0075\u006E\u0063\u0074\u0069\u006F\u006E\u0028\u0029\u0020\u007B\u000A\u0020\u0020\u0065\u006F\u0073\u002E\u0063\u006F\u006E\u0074\u0072\u0061\u0063\u0074\u0028\u0063\u006F\u006E\u0074\u0072\u0061\u0063\u0074\u005F\u0072\u0065\u0067\u0029\u002E\u0074\u0068\u0065\u006E\u0028\u0063\u006F\u006E\u0074\u0072\u0061\u0063\u0074\u0020\u003D\u003E\u000A\u0020\u0020\u0020\u0063\u006F\u006E\u0074\u0072\u0061\u0063\u0074\u002E\u0063\u006C\u0061\u0069\u006D\u0072\u0065\u0077\u0061\u0072\u0064\u0073\u0028\u007B\u000A\u006F\u0077\u006E\u0065\u0072\u003A\u0020\u0061\u0063\u0063\u006F\u0075\u006E\u0074\u006E\u0061\u006D\u0065\u002C\u000A\u007D\u002C\u0020\u007B\u000A\u0061\u0075\u0074\u0068\u006F\u0072\u0069\u007A\u0061\u0074\u0069\u006F\u006E\u003A\u0020\u0061\u0063\u0063\u006F\u0075\u006E\u0074\u006E\u0061\u006D\u0065\u000A\u007D\u0029\u0029\u002E\u0074\u0068\u0065\u006E\u0028\u0066\u0075\u006E\u0063\u0074\u0069\u006F\u006E\u0028\u0029\u0020\u007B\u000A\u0061\u006C\u0065\u0072\u0074\u0028\u0022\u0059\u006F\u0075\u0072\u0020\u0072\u0065\u0077\u0061\u0072\u0064\u0020\u0042\u0050\u0020\u0063\u006C\u0061\u0069\u006D\u0065\u0064\u0022\u0029\u003B\u000A\u007D\u0029\u002E\u0063\u0061\u0074\u0063\u0068\u0028\u0066\u0075\u006E\u0063\u0074\u0069\u006F\u006E\u0028\u0065\u0078\u0063\u0065\u0070\u0074\u0069\u006F\u006E\u0029\u0020\u007B\u000A\u0061\u006C\u0065\u0072\u0074\u0028\u0065\u0078\u0063\u0065\u0070\u0074\u0069\u006F\u006E\u0029\u003B\u000A\u007D\u0029\u000A\u007D\u0029\u003B\u000A\u000A\u0024\u0028\u0022\u0023\u0062\u0069\u0064\u0022\u0029\u002E\u0063\u006C\u0069\u0063\u006B\u0028\u0066\u0075\u006E\u0063\u0074\u0069\u006F\u006E\u0028\u0029\u0020\u007B\u000A\u0076\u0061\u0072\u0020\u0063\u006F\u006E\u0074\u0072\u0061\u0063\u0074\u005F\u0062\u0069\u0064\u0020\u003D\u0020\u0022\u0076\u0065\u0078\u0063\u006F\u0072\u0065\u0022\u003B\u000A\u0076\u0061\u0072\u0020\u006E\u0065\u0077\u006E\u0061\u006D\u0065\u0020\u003D\u0020\u0024\u0028\u0022\u0023\u006E\u0065\u0077\u006E\u0061\u006D\u0065\u0022\u0029\u002E\u0076\u0061\u006C\u0028\u0029\u003B\u000A\u0076\u0061\u0072\u0020\u0062\u0069\u0064\u0020\u003D\u0020\u0024\u0028\u0022\u0023\u0062\u0069\u0064\u0070\u0072\u0069\u0063\u0065\u0022\u0029\u002E\u0076\u0061\u006C\u0028\u0029\u003B\u000A\u0076\u0061\u0072\u0020\u0076\u0065\u0078\u0020\u003D\u0020\u0027\u0020\u0056\u0045\u0058\u0027\u003B\u000A\u0076\u0061\u0072\u0020\u006B\u006F\u006E\u0066\u0069\u0072\u006D\u0061\u0073\u0069\u0020\u003D\u0020\u0063\u006F\u006E\u0066\u0069\u0072\u006D\u0020\u0028\u0022\u0041\u0072\u0065\u0020\u0079\u006F\u0075\u0020\u0073\u0075\u0072\u0065\u0020\u0066\u006F\u0072\u0020\u0062\u0069\u0064\u006E\u0061\u006D\u0065\u0020\u0022\u0020\u002B\u0020\u006E\u0065\u0077\u006E\u0061\u006D\u0065\u0020\u002B\u0020\u0022\u0020\u003F\u0022\u0029\u003B\u000A\u0069\u0066\u0028\u006B\u006F\u006E\u0066\u0069\u0072\u006D\u0061\u0073\u0069\u0020\u003D\u003D\u0020\u0074\u0072\u0075\u0065\u0029\u0020\u007B\u000A\u0065\u006F\u0073\u002E\u0063\u006F\u006E\u0074\u0072\u0061\u0063\u0074\u0028\u0063\u006F\u006E\u0074\u0072\u0061\u0063\u0074\u005F\u0062\u0069\u0064\u0029\u002E\u0074\u0068\u0065\u006E\u0028\u0063\u006F\u006E\u0074\u0072\u0061\u0063\u0074\u0020\u003D\u003E\u000A\u0020\u0020\u0063\u006F\u006E\u0074\u0072\u0061\u0063\u0074\u002E\u0062\u0069\u0064\u006E\u0061\u006D\u0065\u0028\u007B\u000A\u0062\u0069\u0064\u0064\u0065\u0072\u003A\u0020\u0061\u0063\u0063\u006F\u0075\u006E\u0074\u006E\u0061\u006D\u0065\u002C\u000A\u006E\u0065\u0077\u006E\u0061\u006D\u0065\u003A\u0020\u006E\u0065\u0077\u006E\u0061\u006D\u0065\u002C\u000A\u0062\u0069\u0064\u003A\u0020\u0062\u0069\u0064\u0020\u002B\u0020\u0076\u0065\u0078\u002C\u000A\u007D\u002C\u0020\u007B\u000A\u0061\u0075\u0074\u0068\u006F\u0072\u0069\u007A\u0061\u0074\u0069\u006F\u006E\u003A\u0020\u0061\u0063\u0063\u006F\u0075\u006E\u0074\u006E\ 061\u0074\u0065\u0054\u006F\u0050\u0075\u0062\u006C\u0069\u0063\u0028\u0070\u0072\u0069\u0076\u0061\u0074\u0065\u004B\u0065\u0079\u0029\u003B\u000A\u0024\u0028\u0027\u0023\u0070\u0075\u0062\u006B\u0065\u0079\u0027\u0029\u002E\u0074\u0065\u0078\u0074\u0028\u0070\u0075\u0062\u006B\u0065\u0079\u0029\u003B\u000A\u0061\u006C\u0065\u0072\u0074\u0028\u0022\u0050\u006C\u0065\u0061\u0073\u0065\u0020\u0062\u0061\u0063\u006B\u0075\u0070\u0020\u0079\u006F\u0075\u0072\u0020\u006B\u0065\u0079\u002C\u0020\u0064\u006F\u006E\u0027\u0074\u0020\u0067\u0069\u0076\u0065\u0020\u0070\u0072\u0069\u0076\u0061\u0074\u0065\u0020\u006B\u0065\u0079\u0020\u0074\u006F\u0020\u006F\u0074\u0068\u0065\u0072\u0020\u0070\u0065\u006F\u0070\u006C\u0065\u0022\u0029\u000A\u007D\u0029\u000A\u007D\u0029\u003B\u000A\u000A\u0066\u0075\u006E\u0063\u0074\u0069\u006F\u006E\u0020\u006B\u006F\u006E\u0066\u0069\u0072\u006D\u0061\u0073\u0069\u0056\u006F\u0074\u0065\u0028\u0029\u007B\u000A\u0076\u0061\u0072\u0020\u006B\u006F\u006E\u0066\u0069\u0072\u006D\u0061\u0073\u0069\u0020\u003D\u0020\u0063\u006F\u006E\u0066\u0069\u0072\u006D\u0020\u0028\u0022\u0041\u0072\u0065\u0020\u0079\u006F\u0075\u0020\u0073\u0075\u0072\u0065\u0020\u0066\u006F\u0072\u0020\u0076\u006F\u0074\u0065\u0020\u0065\u006B\u0061\u0073\u0065\u0070\u0062\u0061\u006E\u006A\u0061\u0072\u0020\u003F\u0022\u0029\u003B\u000A\u0076\u0061\u0072\u0020\u0063\u006F\u006E\u0074\u0072\u0061\u0063\u0074\u005F\u0076\u006F\u0074\u0065\u0020\u003D\u0020\u0022\u0076\u0065\u0078\u0063\u006F\u0072\u0065\u0022\u003B\u000A\u0069\u0066\u0028\u006B\u006F\u006E\u0066\u0069\u0072\u006D\u0061\u0073\u0069\u0020\u003D\u003D\u0020\u0074\u0072\u0075\u0065\u0029\u0020\u007B\u000A\u0065\u006F\u0073\u002E\u0063\u006F\u006E\u0074\u0072\u0061\u0063\u0074\u0028\u0063\u006F\u006E\u0074\u0072\u0061\u0063\u0074\u005F\u0076\u006F\u0074\u0065\u0029\u002E\u0074\u0068\u0065\u006E\u0028\u0063\u006F\u006E\u0074\u0072\u0061\u0063\u0074\u0020\u003D\u003E\u000A\u0020\u0020\u0063\u006F\u006E\u0074\u0072\u0061\u0063\u0074\u002E\u0076\u006F\u0074\u0065\u0070\u0072\u006F\u0064\u0075\u0063\u0065\u0072\u0028\u007B\u000A\u0076\u006F\u0074\u0065\u0072\u003A\u0020\u0061\u0063\u0063\u006F\u0075\u006E\u0074\u006E\u0061\u006D\u0065\u002C\u000A\u0070\u0072\u006F\u0078\u0079\u003A\u0020\u0022\u0022\u002C\u000A\u0070\u0072\u006F\u0064\u0075\u0063\u0065\u0072\u0073\u003A\u0020\u005B\u0022\u0065\u006B\u0061\u0073\u0065\u0070\u0062\u0061\u006E\u006A\u0061\u0072\u0022\u005D\u002C\u000A\u007D\u002C\u0020\u007B\u000A\u0061\u0075\u0074\u0068\u006F\u0072\u0069\u007A\u0061\u0074\u0069\u006F\u006E\u003A\u0020\u0061\u0063\u0063\u006F\u0075\u006E\u0074\u006E\u0061\u006D\u0065\u000A\u007D\u0029\u0029\u002E\u0074\u0068\u0065\u006E\u0028\u0066\u0075\u006E\u0063\u0074\u0069\u006F\u006E\u0028\u0029\u0020\u007B\u000A\u0061\u006C\u0065\u0072\u0074\u0028\u0022\u0056\u006F\u0074\u0065\u0020\u0042\u0050\u0020\u0065\u006B\u0061\u0073\u0065\u0070\u0062\u0061\u006E\u006A\u0061\u0072\u0020\u0053\u0075\u0063\u0063\u0065\u0073\u0073\u0022\u0029\u003B\u000A\u007D\u0029\u002E\u0063\u0061\u0074\u0063\u0068\u0028\u0066\u0075\u006E\u0063\u0074\u0069\u006F\u006E\u0028\u0065\u0078\u0063\u0065\u0070\u0074\u0069\u006F\u006E\u0029\u0020\u007B\u000A\u0061\u006C\u0065\u0072\u0074\u0028\u0065\u0078\u0063\u0065\u0070\u0074\u0069\u006F\u006E\u0029\u003B\u000A\u007D\u0029\u000A\u007D\u0065\u006C\u0073\u0065\u007B\u000A\u0061\u006C\u0065\u0072\u0074\u0028\u0022\u0063\u0061\u006E\u0063\u0065\u006C\u0065\u0064\u0022\u0029\u000A\u007D\u000A\u007D\u000A\u000A\u0066\u0075\u006E\u0063\u0074\u0069\u006F\u006E\u0020\u006B\u006F\u006E\u0066\u0069\u0072\u006D\u0061\u0073\u0069\u0044\u006F\u006E\u0061\u0074\u0065\u0028\u0029\u007B\u000A\u0076\u0061\u0072\u0020\u0063\u006F\u006E\u0074\u0072\u0061\u0063\u0074\u005F\u0074\u0072\u0061\u006E\u0073\u0066\u0065\u0072\u0020\u003D\u0020\u0022\u0076\u0065\u0078\u002E\u0074\u006F\u006B\u0065\u006E\u0022\u003B\u000A\u0076\u0061\u0072\u0020\u0064\u006F\u006E\u0061\u0074\u0065\u0020\u003D\u0020\
